import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            You can enter in the system
          </p>
          <div className="EnteringForm"

          >
            <input  classNmae="login">
            </input>
            <input classNmae="password">
            </input>
            <button>
              confirm
            </button>
          </div>
        </header>
      </div>
    );
  }
}

export default App;
